import React from "react";
import axios from "axios";

const chats = () => {
  const fetchchats = async () => {
    const data = await axios.get("/api/chats");
    console.log(data);
  };

  useEffect(() => {
    fetchchats();
  }, []);
  return <div>chats</div>;
};

export default chats;
